import React from 'react';

import {
  Container,
  ServiceContainer,
  Title,
  FooterItem,
  InstitutionalContainer,
  SocialContainer,
  DownloadsContainer,
} from './styles';

const Footer: React.FC = () => {
  return (
    <Container>
      <ServiceContainer>
        <Title />
        <FooterItem />
      </ServiceContainer>
      <InstitutionalContainer>
        <Title />
        <FooterItem />
      </InstitutionalContainer>
      <SocialContainer />
      <DownloadsContainer />
      <LineContainer />
      <Title>toSupply</Title>
    </Container>
  );
};

export default Footer;
